import React, { Component } from "react";
import {Route} from "react-router-dom";

//Layout
import RestaurantLayout from "../Layout/RestaurantLayout";

const HomeLayoutHOC = ({component: Component, ...rest}) => {
  return (
    <>
     <Route
       {...rest}
       component={(props)=> (
         <HomeLayout>
          <Component {...rest} />
         </HomeLayout>
       )
       }
     />
    </>
  );
};

export default HomeLayoutHOC;
